import React, { useState } from 'react';
import { CheckCircle, XCircle, Edit2, SkipForward, AlertCircle } from 'lucide-react';
import './CheckpointModal.css';

const CheckpointModal = ({
  isOpen,
  teamName,
  teamOutput,
  aiReview,
  onApprove,
  onDeny,
  onEdit,
  onSkip
}) => {
  const [isEditing, setIsEditing] = useState(false);
  const [editedOutput, setEditedOutput] = useState(teamOutput || '');
  const [denyReason, setDenyReason] = useState('');
  const [showDenyForm, setShowDenyForm] = useState(false);

  if (!isOpen) return null;

  const handleApprove = () => {
    onApprove();
  };

  const handleDeny = () => {
    if (!denyReason.trim()) {
      alert('Please provide a reason for denial');
      return;
    }
    onDeny(denyReason);
    setShowDenyForm(false);
    setDenyReason('');
  };

  const handleEdit = () => {
    if (!editedOutput.trim()) {
      alert('Output cannot be empty');
      return;
    }
    onEdit(editedOutput);
    setIsEditing(false);
  };

  const handleSkip = () => {
    onSkip();
  };

  const getAIReviewIcon = () => {
    if (!aiReview) return null;

    switch (aiReview.status) {
      case 'approved':
        return <CheckCircle className="ai-icon approved" size={20} />;
      case 'warning':
        return <AlertCircle className="ai-icon warning" size={20} />;
      case 'rejected':
        return <XCircle className="ai-icon rejected" size={20} />;
      default:
        return null;
    }
  };

  return (
    <div className="checkpoint-modal-overlay">
      <div className="checkpoint-modal">
        <div className="checkpoint-header">
          <h2>ðŸ›‘ Checkpoint: {teamName} Complete</h2>
          <p className="checkpoint-subtitle">Review the output before continuing to the next team</p>
        </div>

        {aiReview && (
          <div className={`ai-review ${aiReview.status}`}>
            <div className="ai-review-header">
              {getAIReviewIcon()}
              <span className="ai-review-title">AI Review</span>
            </div>
            <p className="ai-review-message">{aiReview.message}</p>
            {aiReview.issues && aiReview.issues.length > 0 && (
              <ul className="ai-review-issues">
                {aiReview.issues.map((issue, index) => (
                  <li key={index}>{issue}</li>
                ))}
              </ul>
            )}
          </div>
        )}

        <div className="checkpoint-content">
          <h3>Team Output:</h3>
          {isEditing ? (
            <div className="edit-section">
              <textarea
                className="output-editor"
                value={editedOutput}
                onChange={(e) => setEditedOutput(e.target.value)}
                rows={15}
              />
              <div className="edit-actions">
                <button className="cancel-edit-btn" onClick={() => setIsEditing(false)}>
                  Cancel
                </button>
                <button className="save-edit-btn" onClick={handleEdit}>
                  Save Changes & Continue
                </button>
              </div>
            </div>
          ) : (
            <div className="output-display">
              <pre className="output-text">{teamOutput || 'No output available'}</pre>
            </div>
          )}
        </div>

        {showDenyForm && (
          <div className="deny-form">
            <h4>Reason for Denial</h4>
            <textarea
              placeholder="Explain what needs to be fixed..."
              value={denyReason}
              onChange={(e) => setDenyReason(e.target.value)}
              rows={4}
            />
            <div className="deny-actions">
              <button className="cancel-btn" onClick={() => {
                setShowDenyForm(false);
                setDenyReason('');
              }}>
                Cancel
              </button>
              <button className="confirm-deny-btn" onClick={handleDeny}>
                Confirm Denial
              </button>
            </div>
          </div>
        )}

        {!isEditing && !showDenyForm && (
          <div className="checkpoint-actions">
            <button className="action-btn approve-btn" onClick={handleApprove}>
              <CheckCircle size={18} />
              Approve
              <span className="btn-hint">Continue with original output</span>
            </button>

            <button className="action-btn deny-btn" onClick={() => setShowDenyForm(true)}>
              <XCircle size={18} />
              Deny
              <span className="btn-hint">Stop and provide feedback</span>
            </button>

            <button className="action-btn edit-btn" onClick={() => setIsEditing(true)}>
              <Edit2 size={18} />
              Edit
              <span className="btn-hint">Modify output before continuing</span>
            </button>

            <button className="action-btn skip-btn" onClick={handleSkip}>
              <SkipForward size={18} />
              Skip
              <span className="btn-hint">Auto-approve this checkpoint</span>
            </button>
          </div>
        )}

        <div className="checkpoint-footer">
          <p className="checkpoint-info">
            ðŸ’¡ <strong>Tip:</strong> Review the output carefully. Approve to continue, Deny to stop,
            Edit to make changes, or Skip to auto-approve this checkpoint.
          </p>
        </div>
      </div>
    </div>
  );
};

export default CheckpointModal;
